import React, { useEffect } from "react";
import { useCart } from "../context/CartContext";
import { Link, useNavigate } from "react-router-dom";
import "./CartPage.css";

const CartPage = () => {
  const {
    cart,
    cartTotal,
    loading,
    error,
    removeFromCart,
    updateCartItem,
    clearError,
  } = useCart();

  const navigate = useNavigate();

  // Debug cart data on every render
  useEffect(() => {
    console.log("Cart data:", cart);
  }, [cart]);

  const handleQuantityChange = (productId, newQuantity) => {
    if (newQuantity < 1) return;
    updateCartItem(productId, newQuantity);
  };

  // New: Buy Now handler to buy a single product immediately
  const handleBuyNow = (productId, quantity) => {
    // Navigate to checkout page with query params or state for this single product and quantity
    navigate("/buy-now", {
      state: { singleProduct: { productId, quantity } },
    });
  };

  if (loading && cart.length === 0) {
    return <div className="loading">Loading cart...</div>;
  }

  if (error) {
    return (
      <div className="error">
        {error}
        <button onClick={clearError}>Dismiss</button>
      </div>
    );
  }

  return (
    <div className="cart-container">
      <h1>Shopping Cart</h1>
      {cart.length === 0 ? (
        <div className="empty-cart">
          <p>Your cart is empty</p>
          <Link to="/Dashboard" className="btn">
            Continue Shopping
          </Link>
        </div>
      ) : (
        <div className="cart-content">
          <div className="cart-items">
            {cart.map((item) => {
              if (!item.product) return null;

              const { _id, image, name, price } = item.product;
              return (
                <div key={_id} className="cart-item">
                  <div className="item-image">
                    <img src={image} alt={name} />
                  </div>
                  <div className="item-details">
                    <h3>{name}</h3>
                    <p>₹{price.toFixed(2)}</p>
                    <div className="quantity-control">
                      <button
                        onClick={() =>
                          handleQuantityChange(_id, item.quantity - 1)
                        }
                        disabled={item.quantity <= 1}
                      >
                        -
                      </button>
                      <span>{item.quantity}</span>
                      <button
                        onClick={() =>
                          handleQuantityChange(_id, item.quantity + 1)
                        }
                      >
                        +
                      </button>
                    </div>
                    <button
                      onClick={() => removeFromCart(_id)}
                      className="remove-btn"
                    >
                      Remove
                    </button>
                    {/* New Buy Now Button */}
                    <button
                      className="buy-now-btn"
                      onClick={handleBuyNow}
                      style={{ marginLeft: "10px" }}
                    >
                      Buy Now
                    </button>
                  </div>
                  <div className="item-total">
                    ₹{(price * item.quantity).toFixed(2)}
                  </div>
                </div>
              );
            })}
          </div>

          <div className="cart-summary">
            <h2>Order Summary</h2>
            <div className="summary-row">
              <span>Subtotal</span>
              <span>₹{Number(cartTotal).toFixed(2)}</span>
            </div>
            <div className="summary-row">
              <span>Shipping</span>
              <span>Free</span>
            </div>
            <div className="summary-row total">
              <span>Total</span>
              <span>₹{Number(cartTotal).toFixed(2)}</span>
            </div>
            <Link to="/checkout" className="btn checkout-btn">
              Proceed to Checkout
            </Link>
          </div>
        </div>
      )}
    </div>
  );
};

export default CartPage;
